import React from 'react';
import Sdata from './Sdata';
import Card from './Card';
const FavSeries = 'tvf';

// const FavSSeries = () => {
//   if (fseries === 'tvf') {
//     return <Tvf />;
//   } else {
//     return <Amazon />;
//

// };

const App = () => (
  <>
    <h1 className='heading'>Best Web Series</h1>

    <Card
      key={Sdata.id}
      simg={Sdata.simg}
      sname={Sdata.sname}
      stitle={Sdata.stitle}
      slink={Sdata.slink}
    />
  </>
);

export default App;
